"use strict";

function f_gold(mapping, nums) {
    let m = [];
    for (let i = 0; i < nums.length; i++) {
        let a = nums[i], b = 0, t = 1;
        while (true) {
            let [q, x] = [Math.floor(a / 10), a % 10];
            x = mapping[x];
            b = x * t + b;
            t *= 10;
            if (q === 0) {
                break;
            }
            a = q;
        }
        m.push([b, i, nums[i]]);
    }
    m.sort((a, b) => a[0] - b[0]);
    for (let i = 0; i < m.length; i++) {
        nums[i] = m[i][2];
    }
    return nums;
}
